import React, { useState } from 'react';
import Login from './components/Login';
import UserList from './components/UserList';
import TransactionList from './components/TransactionList';
import UserDetails from './components/UserDetails';
import SupportChat from './components/SupportChat';

function App() {
  const [loggedIn, setLoggedIn] = useState(false);
  const [selectedUser, setSelectedUser] = useState(null);

  if (!loggedIn) return <Login onLogin={() => setLoggedIn(true)} />;

  return (
    <div className="bg-light min-vh-100">
      <nav className="navbar navbar-expand-lg navbar-dark bg-primary mb-4">
        <div className="container">
          <a className="navbar-brand fw-bold" href="#">
            <img src="https://www.emc2group.io/uploads/logo_white.svg" alt="EMC2 Group" height={32} className="me-2" />
            Moroccoin Admin Panel
          </a>
        </div>
      </nav>
      <div className="container mb-5">
        <div className="row">
          <div className="col-md-3">
            <UserList onSelectUser={setSelectedUser} />
          </div>
          <div className="col-md-5">
            <TransactionList />
            {selectedUser && <UserDetails userId={selectedUser} />}
          </div>
          <div className="col-md-4">
            <SupportChat />
          </div>
        </div>
      </div>
      <footer className="bg-primary text-white text-center p-3 mt-auto">
        &copy; {new Date().getFullYear()} EMC2 Group - Moroccoin
      </footer>
    </div>
  );
}

export default App;
